import React from "react";
import "./Landing.css";

interface IProps {
  modal: boolean;
  setModal: (modal: boolean) => void;
}

const Landing: React.FunctionComponent<IProps> = ({ modal, setModal }) => {
  return (
    <div className="modal">
      <form>
        <label>Player Name</label>
        <input type="text" />
        <button onClick={() => setModal(false)}>ENTER</button>
      </form>
    </div>
  );
};

export default Landing;
